    font: {
        flexGrow: 1,
        color: '#00000',
        fontFamily: 'liebedoni-solid',
        fontSize: 20,
        marginTop: 15,
    },
    text: {
        flexGrow: 1,
        display: 'flex',
        alignItems: 'center',
        color: '#000000',
        fontSize: 20,
        marginLeft: 5,
    },
    icon: {
        marginRight: 'auto',
        marginLeft: 'auto',
        alignItems: 'center',
        justifyContent: 'center',
        color: '#FF6C00'
    }
    }));

